INSERT INTO "cms_tree" VALUES (1,1,1,1416084922,1465241756,'Главная страница',NULL,NULL,'','',NULL,NULL,'1',0,NULL,0,NULL,'','N','Магазин одежды','Магазин одежды','',1,'text','editor',NULL,301,'','',1),(9,1,1,1442576764,1465241761,'Каталог',NULL,NULL,'','','catalog',1,'1/9',1,'catalog',200,NULL,'','Y','','','',5,'text','text',NULL,301,'','',1),(17,1,1,1442577460,1465241761,'Контакты',NULL,NULL,'','<h1 style=\"font-family: Pfdindisplaypro-reg; margin: 0px 0px 20px; color: rgb(14, 14, 14); line-height: normal; font-size: 26px !important;\"><br />\r\n&nbsp;</h1>\r\n','contacts',1,'1/17',1,'contacts',500,NULL,'','Y','Контакты мотосалона, Москва, МКАД, ТК \"АНГАР АВТО\" (2 этаж, левое крыло мотосалон SELECT MOTO)','Контактная информация Select-moto: Email: selectmoto@yandex.ru, +7 (499) 390-89-58, Москва, МКАД, ТК \"АНГАР АВТО\" (2 этаж, левое крыло мотосалон SELECT MOTO)','',2,'text','editor',NULL,301,'','contacts',1),(70,1,1,1456996581,1465241761,'Бренды',NULL,NULL,'','','brands',1,'1/70',1,'brands',300,NULL,'','Y','','','',2,'text','text',NULL,301,'','brands',1),(76,1,1,1457010208,1465241761,'Распродажа',NULL,NULL,'','','rasprodaja',1,'1/76',1,'rasprodaja',400,NULL,'','Y','','','',2,'text','text',NULL,301,'','sale',1),(77,1,1,1457010249,1465302250,'Доставка и оплата',NULL,NULL,'','<p style=\"line-height: 20.8px;\"><strong><span style=\"font-size: 16px;\"><u>Доставка</u></span></strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\"><u><strong>Курьерская доставка по Москве</strong></u></p>\r\n\r\n<p style=\"line-height: 20.8px;\">Курьерская служба&nbsp;<strong>jhanway</strong>&nbsp;аккуратно доставит Ваш заказ в пределах МКАД на следующий день после заказа. Теперь у Вас есть возможность оплатить заказ после примерки.&nbsp;</p>\r\n\r\n<p style=\"line-height: 20.8px;\">&nbsp; &nbsp;<img alt=\"\" src=\"/uploads/all/b5/17/e4/b517e480cf8bc89086b4d40198c6f8df.gif\" style=\"width: 450px; height: 536px;\" /></p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>Стоимость доставки в пределах МКАД:</strong></p>\r\n\r\n<ul style=\"line-height: 20.8px;\">\r\n	<li>При единовременном заказе от 3000&nbsp;рублей - включена в стоимость заказа*&nbsp;</li>\r\n	<li>При заказе до 3000&nbsp;рублей - 280 рублей</li>\r\n	<li>Выезд курьера за пределы МКАД уточняйте у оператора</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 20.8px;\"><span style=\"font-size: 10px; line-height: 16px;\">*Если одежда Вам&nbsp;не подошла&nbsp;оплачивается услуга курьерской доставки.</span></p>\r\n\r\n<hr />\r\n<p style=\"line-height: 20.8px;\">&nbsp;</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><u><strong>Экспресс доставка по России</strong></u></p>\r\n\r\n<p style=\"line-height: 20.8px;\">Интернет магазин jhanway&nbsp;имеет возможность доставки вашего заказа в любой регион Российской Федерации. Мы работаем с надежными службами доставки <span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;\">&nbsp;</span><a href=\"http://emspost.ru/ru/\" style=\"color: rgb(56, 176, 227); font-family: Arial, Helvetica, sans-serif; line-height: normal; font-size: 12px; cursor: pointer;\">EMS RUSSIAN POST</a><span style=\"color: rgb(0, 0, 0); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;\">,&nbsp;</span><a href=\"http://www.ponyexpress.ru/\" style=\"color: rgb(56, 176, 227); font-family: Arial, Helvetica, sans-serif; line-height: normal; font-size: 12px; cursor: pointer;\">PONY EXPRESS</a>. &nbsp;Сроки доставки зависят от удаленности от Москвы (средний срок получения от 2 до 7 рабочих дней)&nbsp;<img alt=\"\" src=\"/uploads/all/79/68/1b/79681b30c9fdf88770962e5020c5e7c7.png\" style=\"width: 842px; height: 453px;\" /></p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong>Стоимость доставки в пределах РФ:</strong></p>\r\n\r\n<ul style=\"line-height: 20.8px;\">\r\n	<li><span style=\"line-height: 20.8px;\">При единовременном заказе от 5990&nbsp;рублей - включена в стоимость заказа</span></li>\r\n	<li><span style=\"line-height: 20.8px;\">При заказе до 5990 рублей - 300-700 рублей&nbsp;</span><span style=\"line-height: 20.8px;\">&nbsp;&nbsp;</span></li>\r\n</ul>\r\n\r\n<p><span style=\"line-height: 20.8px;\">За подробной информацией о сроках&nbsp;получения и&nbsp;расчете стоимости&nbsp;перейдите на сайт.</span></p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong><span style=\"font-size: 16px;\"><u><span style=\"line-height: 20.8px;\">Оплата</span></u></span></strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\">В пределах Москвы производится курьеру.&nbsp;</p>\r\n\r\n<p style=\"line-height: 20.8px;\">Оформите&nbsp;экспресс доставку&nbsp;по России,&nbsp;оплата&nbsp;при&nbsp;получении в пункте выдачи.&nbsp;</p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong><u>Способы оплаты:&nbsp;</u></strong></p>\r\n\r\n<p style=\"line-height: 20.8px;\"><strong><u><img alt=\"\" src=\"/uploads/all/09/21/16/0921164132bc2c153b9b1af9edf86b9a.jpg\" style=\"margin-left: 25px; margin-right: 25px; width: 400px; height: 299px;\" /></u></strong></p>\r\n\r\n<ul style=\"line-height: 20.8px;\">\r\n	<li>Внимание! &nbsp;при оплате банковской картой&nbsp;просим заранее уведомить оператора при оформлении заказа.&nbsp;</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n','dostavka',1,'1/77',1,'dostavka',600,NULL,'','Y','','','',2,'text','editor',NULL,301,'','',1),(1343,1,1,1460532540,1465241761,'Обратная связь',NULL,NULL,'','','feedback',1,'1/1343',1,'feedback',700,NULL,'','N','','','',2,'text','text',NULL,301,'','feedback',1),(1422,1,1,1465224555,1465241477,'Аксессуары',NULL,NULL,NULL,NULL,'aksessuaryi',9,'1/9/1422',2,'catalog/aksessuaryi',400,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1423,1,1,1465224565,1465241477,'Одежда',NULL,NULL,NULL,NULL,'odejda',9,'1/9/1423',2,'catalog/odejda',500,NULL,NULL,'Y',NULL,NULL,NULL,5,'text','text',NULL,301,NULL,NULL,1),(1424,1,1,1465224641,1465241477,'Обувь',NULL,NULL,NULL,NULL,'obuv',9,'1/9/1424',2,'catalog/obuv',600,NULL,NUL